import SplashScreen from './Components/SplashScreen'

function App() {
  const initialState = {}
  const [state, dispatch] = useReducer(reducer, initialState)
  return (
    <div className="App">
      <ContextProvider.provider values={{state, dispatch}}>

      </ContextProvider.provider>
    </div>
  );
}

export default App;
